Geometry SetMr. Pen Story: Committed to Quality and ServiceHaving firsthand experience teaching in at-risk schools in different parts of the United States, seeing the daily struggles of students and teachers, we, a few business-minded teachers, founded Mr. Pen with a simple purpose: serving the schools in our community by providing real solutions for real problems and meeting the needs which we faced and experienced with our bones. To certify success, we are starting small with only a few products to expand in the future. .

We, at Mr. Pen, believe in our children’s future and want to invest in them. One way of investment is educating them; consequently we contribute a portion of our proceeds to our community foundations and schools.
 
 Mr. Pen is a values-driven company, guided by the principles of excellence through strong product design. Our commitment to these values is to be reflected in our dedication to improve current products and develop new exciting products for our consumers. To achieve this goal we appreciate all the help we receive from anyone who uses our products.What's Included:
Compasses:

Easy to Handle and Use
One Graphic Compass with Extra Lead for Drawing and One Study Compass for Geometry
Draw Perfect Circles from ¼” to 6” in Radius Using Graphic Compass and ¼” to 5 ¼” in Radius with Study Compass


Divider:

5 ¼” Point to Point Measurement
Useful Measurement Transfer Tool for Uneven Surfaces


