Eraser
Ruler (6”), Set Square (30°/60°), Set Square (45°), Protractor:

Inch and centimeter
Transparent Color for Better Visibility


Protractor with Swing Arm

Easy-to-Read Inch and Centimeter
Swing Arm for Drawing Accurate Angles and Arcs



How to use:How to draw a circle?How to draw an arc?Get creative!
Open the compass to the radius desired for your circle.
Place the compass point on a piece of paper where you would like the center point of the circle to be.
Place the point of the pencil/lead on the paper.
Rotate the compass to mark a circle on the paper with the pencil. Draw without lifting the point of the compass off the paper.
	 
	 


Place the center of the protractor on the tip of the line, where you would like to draw the angle or arc.
Swing the arm all the way to the opposite side.
Hold the pencil in the grove and draw to your desired angle.


A compass is a handy drawing tool to have around. Use it to draw circles, make equal line segments or find the midpoint of a line.

	You can also get creative and draw symmetric shapes such as Flower of Life, or Mr. Pen Mustache.

